import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('reqPrepend', () => {
    test('ok', async () => {
        const r1 = await request({
            url: 'https://reqprepend.reqbody.reqappend.test.whistlejs.com/',
            method: 'post'
        });
        expect(r1.data.body).toBe('prependbodyappend');
        const r2 = await request({
            url: 'http://reqprepend.reqbody.reqappend.test.whistlejs.com/',
            method: 'post'
        });
        expect(r2.data.body).toBe('prependbodyappend');
    });
});
